import React from 'react';


function ChooseActivity() {
  return (
    <div className="ButtonList">
      Choose next activity?<br/><hr/>
      <button >
        Wash
      </button>
      <button >
        Exercise
      </button>
      <button >
        Study
      </button>


    </div>
  );
}

export default ChooseActivity;
